    [],nt"num_tags": 4,nt"name": "iroquois-national-wildlife-refuge-annual-narrative-report-calendar-year-1977",nt"isopen":
    false,nt"url": null,nt"notes": "This narrative report for Iroquois NWR
    outlines Refuge accomplishments during the 1977 calendar year. The report begins
    with an introduction to the Refuge and information about weather conditions, habitat
    conditions, and the system status. Construction and maintenance are also described.
    Habitat management is covered; croplands, grasslands, wetlands, forests, and wilderness
    areas are discussed. The wildlife section of the report discusses endangered and
    threatened species, migratory birds, mammals, and non-migratory birds. Interpretation
    and recreation activities are outlined; topics include information and interpretation,
    recreation, and law enforcement. Field investigations, cooperative programs, items
    of interest, and safety information are attached.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
